  \"2013-03-19T00:27:49.056970\",\n\t\"name\": \"alaska-geologic-data-index-agdi\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Alaska Geologic Data Index (AGDI) is
  an actively growing index of unpublished geologic data collected throughout the
  state of Alaska. The records captured range from project documents to imagery to
  geochemical data. The index is designed to contain data and documents pertaining
  to all related fields of geology, including oil and gas, geologic engineering, minerals
  industry, scientific data, and agency archives. The index can refer to paper or
  digital information. Agencies, institutions, and the public are encouraged to contribute
  unpublished data to this dataset. Data owners can pick from three levels of data
  availability. These include: public - the data records in AGDI are visible to the
  public, and the archived documents are also available to the public; limited - the
  data records in AGDI are visible to the public, but the archived documents may not
  be available or are available at the discretion of the data owner; and private -
  records are visible only to the owner of the records and AGDI database administrator,
  and the archived documents may not be available or are available at the discretion
  of the data owner. If you would like to contribute data to this index, please contact
  the Alaska Division of Geological & Geophysical Surveys (DGGS) at dnr.dggs.webapps@alaska.gov
  to obtain a username and password for the application. A username and password may
  either be assigned to a specific individual or designed to be shared among individuals.
  For example, a username and password may be shared within the organization so that
  more than one individual in the organization can edit the records and query records
  that are private. Maintaining the appropriate privacy of a username and password
  is the responsibility of the record owner.\",\n\t\"license_title\": null,\n\t\"extras\":
